export const setCurriculo = (curriculo) => ({
  type: 'CURRICULO',
  payload: curriculo,
});

export const setCargo = (cargo) => ({
  type: 'CARGO',
  payload: cargo,
});

export const setDescricao = (descricao) => ({
  type: 'DESCRICAO',
  payload: descricao,
});
